// index.js
require('dotenv').config();
const express = require('express');
const cors = require('cors');
const path = require('path');
const mongoose = require('mongoose');
const Contact = require('./models/Contact');

const contactsRouter = require('./routes/contacts');

const app = express();
const PORT = process.env.PORT || 8080;

app.use(cors()); 
app.use(express.json());


app.use('/', express.static(path.join(__dirname, '../frontend')));

mongoose.connect(process.env.MONGO_URI)
  .then(() => console.log('MongoDB connected'))
  .catch(err => console.error('MongoDB connection error:', err));


const seedContacts = async () => {
  const count = await Contact.countDocuments();
  if (count === 0) {
    await Contact.insertMany([
      {
        firstName: "Ana",
        lastName: "Pérez",
        email: "ana@example.com",
        favoriteColor: "Blue",
        birthday: "1998-04-12"
      },
      {
        firstName: "Luis",
        lastName: "Martínez",
        email: "luis@example.com",
        favoriteColor: "Green",
        birthday: "1995-11-20"
      },
      {
        firstName: "Sara",
        lastName: "Lopez",
        email: "sara@example.com",
        favoriteColor: "Red",
        birthday: "2000-02-10"
      }
    ]);
    console.log("Sample contacts inserted!");
  }
};
seedContacts();

app.use('/contacts', contactsRouter);

const professionalData = {
  professionalName: "Lilly Armenta",
  base64Image: "",
  nameLink: {
    firstName: "Lilly",
    url: "https://example.com"
  },
  primaryDescription: " — Full Stack Developer.",
  workDescription1: "Experienced Data Engineer specialized in building efficient and scalable data solutions using modern cloud technologies.",
  workDescription2: "Currently expanding my expertise into full stack development to deliver end-to-end, data-driven applications.",
  linkTitleText: "Professional Network",

  linkedInLink: {
    text: "LinkedIn",
    link: "https://www.linkedin.com/in/lilly-dlreyes/"
  },
  githubLink: {
    text: "GitHub",
    link: "https://github.com/LillyRox"
  }
};

app.get('/professional', (req, res) => res.json(professionalData));
app.get('/health', (req, res) => res.send({ status: 'ok' }));

app.listen(PORT, () => console.log(`Server running on http://localhost:${PORT}`));